    false,nt"url": null,nt"notes": "This narrative report for Kenai National
    Wildlife Refuge summarizes refuge activities from January through April of 1950.
    The report begins with general information about weather conditions and fires on
    the refuge.  Wildlife- including migratory birds, upland game birds, big game animals,
    fur animals, and fish- is also covered.  The report includes a refuge development
    section which discusses physical developments on the refuge.  Economic uses of the
    refuge are outlined; fur harvest and timber removal were the only uses during this
    period.  A progress report on field investigations is included, as well as a winter
    water analysis of lakes.  The public relations section of the report discusses recreational
    uses of the refuge, refuge visitors, refuge participation, and enforcement.  Photographs
    and N-R forms are provided at the end of the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
